text:
Replying to @RyanAFournier @realDonaldTrump did get rid of the NSC Pandemic unit.

@realDonaldTrump ignored advice.

@realDonaldTrump lies all the time.

Replying to @RyanAFournier Sir,
My riposte:
(1) His budget proposed cuts, funding restored by Congress;
(2) Head of unit eliminated, duties dispersed in NSC;
(3) Called concerns about the virus a Hoax;
(4) Failed to act on science-based intel reports.
